import React from "react";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import "bootstrap/dist/css/bootstrap.css";
import "./App.css";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import EditExpense from "./components/EditProduct";
import ExpensesList from "./components/ProductList";
import CreateExpense from "./components/CreateProduct";

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <Navbar bg="success" variant="success">
            <Container>
              <Navbar.Brand>
                <Link
                  to={"/create"}
                  className="nav-link"
                  style={{ color: "#fff" }}
                >
                  Product manager
                </Link>
              </Navbar.Brand>

              <Nav className="justify-content-end">
                <Nav>
                  <Link
                    to={"/create-expense"}
                    className="nav-link"
                    style={{ color: "#fff" }}
                  >
                    Create Expense
                  </Link>
                  <Link
                    to={"/expenses-listing"}
                    className="nav-link"
                    style={{ color: "#fff" }}
                  >
                    Expenses List
                  </Link>
                </Nav>
              </Nav>
            </Container>
          </Navbar>
        </header>

        <Container>
          <Row>
            <Col md={12}>
              <div className="wrapper">
                <Switch>
                  <Route exact path="/" component={CreateExpense} />
                  <Route path="/create-expense" component={CreateExpense} />
                  <Route path="/edit-expense/:id" component={EditExpense} />
                  <Route path="/expenses-listing" component={ExpensesList} />
                </Switch>
              </div>
            </Col>
          </Row>
        </Container>
      </div>
    </Router>
  );
}

export default App;
